import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';

import SignupForm from './Signup';

function App() {
    return (
        <div>
            <h1>Hello, React!</h1>
            <BrowserRouter>
            <Router>
            <div>
                <Routes>
                    <Route path="/" element={<SignupForm />} />
                    {/* Add other routes here */}
                </Routes>
            </div>
        </Router>
  </BrowserRouter>

        </div>
    );
}

export default App;
